from fastapi import FastAPI
from pydantic import BaseModel
import prediccion

app = FastAPI()
#http://127.0.0.0:8000

class Imagen(BaseModel):
        cod_base64: str

@app.get("/")
def index():
        return {"mensaje": "Hola"}

@app.get("/Imagen/{id}")
def mostrar_img(id: int):
        return {"data":id}

@app.get("/Prueba/{id}")
def dt(data: str):
        return {"data":data}

@app.post("/Img_base64")
def insertar_img(imagen: Imagen):
        # base64_image = ""
        respuesta = prediccion.funcion(imagen.cod_base64)
        ss = respuesta["text"]
        return ss
